(function($) {

function smoothScroll() {
  // Select all links with hashes
$('a[href*="#"]')
  // Remove links that don't actually link to anything
  .not('[href="#"]')
  .not('[href="#0"]')
  .click(function(event) {
    // On-page links
    if (
      location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') 
      && 
      location.hostname == this.hostname
    ) {
      // Figure out element to scroll to
      var target = $(this.hash);
      target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
      // Does a scroll target exist?
      if (target.length) {
        // Only prevent default if animation is actually gonna happen
        event.preventDefault();
        $('html, body').animate({
          scrollTop: target.offset().top
        }, 600, function() {
          // Callback after animation
          // Must change focus!
          var $target = $(target);
          $target.focus();
          if ($target.is(":focus")) { // Checking if the target was focused
            return false;
          } else {
            $target.attr('tabindex','-1'); // Adding tabindex for elements not focusable
            $target.focus(); // Set focus again
          };
        });
      }
    }
  }); 
}

  
  function homeHeights() {
    $('.secondary-container .columns').equalHeights();
  }
  
  function homeSlider() {

    var $slider = $('.home-slides');

    $('.home-slides').on('init', function(event, slick) {
      setTimeout(homeHeights, 200);
      $('.home-slides').css({
        'opacity': "1",
        'height': 'auto'
      });
    });

    $('.home-slides').slick({
      dots: true,
      autoplay: true,
      autoplaySpeed: 7000,
      arrows: false
    });


    
  }

  $(window).load(function() {
    smoothScroll();
    setTimeout(homeSlider, 200);
  });
  

  
})( jQuery );


// update Feb 2021
const mobileSearch = () => {
  // Mobile search functionality

  const searchForm = document.querySelector('.header-wrapper .search-form');
  const searchButton = document.querySelector('.header-wrapper .search-form-submit');
  const homeLogo = document.querySelector('.header-home-logo');

  // run if below 900px
  if (window.innerWidth < 1040) {

    searchButton.addEventListener('click', function(event) {
      
      if ( searchForm.classList.contains('search-open') ) {
        homeLogo.style.display = '';
        searchForm.classList.remove('search-open');
      } else {
        event.preventDefault();
        homeLogo.style.display = 'none';
        searchForm.classList.add('search-open');
      }

    });
  }
}

const artistForm = () => {
  const $category = document.querySelector('.cat-name-hidden');
  const $act = document.querySelector('.act-name-hidden');
  const $formInputBand = document.querySelector('.wpcf7-form-control-wrap.band-name input');

  if ( $category ) {
    $formInputBand.value = $act.textContent + ': ' + $category.textContent;
  } 
}

const moreAnimation = () => {
  const $moreArrow = document.querySelector('.more-content .fa');

  if ( $moreArrow ) {
    gsap.to($moreArrow, {
    	duration: .5, 
    	y: 10,
    	yoyo: true,
    	repeat: -1,
    });
  } 
}

window.addEventListener('DOMContentLoaded', (event) => {
  console.log('DOM fully loaded and parsed');
  mobileSearch();
});

window.addEventListener('load', (event) => {
  console.log('page is fully loaded');
  artistForm();
  moreAnimation();
});





  


































